import React from 'react';
import { Box, Typography, Button } from '@mui/material';
import { styled } from '@mui/system';
import { motion } from 'framer-motion'; // For animations

// Styled Components for Hero Section (Section 1)
const HeroSection = styled(Box)({
  backgroundImage: `url('https://images.unsplash.com/photo-1523381210434-271e8be1f52b?ixlib=rb-4.0.3&auto=format&fit=crop&w=1350&q=80')`,
  backgroundSize: 'cover',
  backgroundPosition: 'center',
  height: '100vh', // Full viewport height for a grander look
  display: 'flex',
  flexDirection: 'column',
  justifyContent: 'center',
  alignItems: 'center',
  color: '#ffffff',
  textAlign: 'center',
  padding: '0 40px',
  position: 'relative',
  '&:before': {
    content: '""',
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    background: 'linear-gradient(135deg, rgba(0, 0, 0, 0.7), rgba(50, 50, 50, 0.4))', // Gradient overlay for depth
  },
});

const HeroTitle = styled(Typography)({
  fontSize: { xs: '3.5rem', md: '6rem' }, // Larger font for a bold statement
  fontWeight: 900,
  letterSpacing: '4px',
  textTransform: 'uppercase',
  color: '#ffffff',
  textShadow: '0 4px 20px rgba(0, 0, 0, 0.5)', // Enhanced shadow for depth
  background: 'linear-gradient(90deg, #ffffff, #d4d4d4)', // Gradient text effect
  WebkitBackgroundClip: 'text',
  WebkitTextFillColor: 'transparent',
  position: 'relative',
  zIndex: 1,
  marginBottom: '20px',
});

const HeroSubtitle = styled(Typography)({
  fontSize: { xs: '1.2rem', md: '1.8rem' },
  fontWeight: 300,
  lineHeight: 1.6,
  color: '#e0e0e0',
  maxWidth: '1000px',
  zIndex: 1,
  marginBottom: '40px',
  letterSpacing: '1px',
});

const HeroButton = styled(Button)({
  background: 'linear-gradient(45deg, #ffffff, #e0e0e0)', // Gradient button background
  color: '#1a1a1a',
  padding: '18px 60px',
  fontSize: '1.4rem',
  fontWeight: 'bold',
  borderRadius: '50px',
  textTransform: 'uppercase',
  boxShadow: '0 6px 25px rgba(255, 255, 255, 0.3)',
  transition: 'transform 0.3s ease, box-shadow 0.3s ease, background 0.3s ease',
  zIndex: 1,
  '&:hover': {
    background: 'linear-gradient(45deg, #e0e0e0, #ffffff)',
    transform: 'translateY(-5px)',
    boxShadow: '0 10px 30px rgba(255, 255, 255, 0.5)',
  },
});

// Styled Components for Business Introduction Section (Section 2)
const BusinessIntroSection = styled(Box)({
  padding: '120px 40px', // More spacious padding
  background: 'linear-gradient(180deg, #e6f0fa, #f5faff, #e6f0fa)', // Light blue gradient with a soft return
  color: '#1a2a44', // Dark navy text
  textAlign: 'center',
  width: '100%',
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  justifyContent: 'center',
  minHeight: '60vh',
  position: 'relative',
  overflow: 'hidden',
  '&:before': {
    content: '""',
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    background: 'radial-gradient(circle, rgba(255, 255, 255, 0.2), transparent)', // Subtle radial glow
    zIndex: 0,
  },
});

const Subtitle = styled(Typography)({
  fontSize: '1.1rem',
  fontWeight: 500,
  letterSpacing: '3px',
  textTransform: 'uppercase',
  color: '#1a2a44',
  marginBottom: '15px',
  zIndex: 1,
  background: 'linear-gradient(90deg, #1a2a44, #4a5a74)', // Gradient text
  WebkitBackgroundClip: 'text',
  WebkitTextFillColor: 'transparent',
});

const MainTitle = styled(Typography)({
  fontSize: { xs: '3rem', md: '4.5rem' }, // Larger for impact
  fontWeight: 800,
  letterSpacing: '2px',
  color: '#1a2a44',
  fontFamily: "'Times New Roman', serif",
  marginBottom: '40px',
  zIndex: 1,
  position: 'relative',
  '&:after': {
    content: '""',
    position: 'absolute',
    width: '100%',
    height: '2px',
    background: 'linear-gradient(90deg, #1a2a44, #4a5a74)', // Gradient underline
    bottom: '-10px',
    left: '50%',
    transform: 'translateX(-50%)',
  },
});

const IntroButton = styled(Button)({
  border: '1px solid #1a2a44',
  color: '#1a2a44',
  padding: '12px 40px',
  fontSize: '1rem',
  fontWeight: 600,
  borderRadius: '30px',
  textTransform: 'uppercase',
  margin: '0 15px',
  background: 'linear-gradient(45deg, #ffffff, #f0f0f0)', // Subtle gradient background
  transition: 'all 0.3s ease',
  zIndex: 1,
  boxShadow: '0 4px 15px rgba(0, 0, 0, 0.1)',
  '&:hover': {
    background: 'linear-gradient(45deg, #1a2a44, #2a3a54)',
    color: '#ffffff',
    boxShadow: '0 6px 20px rgba(0, 0, 0, 0.2)',
    transform: 'translateY(-3px)',
  },
});

// Animation Variants for Fade-In and Slide-Up Effects
const fadeInUp = {
  hidden: { opacity: 0, y: 50 },
  visible: {
    opacity: 1,
    y: 0,
    transition: { duration: 0.8, ease: 'easeOut' },
  },
};

const staggerContainer = {
  hidden: { opacity: 0 },
  visible: {
    opacity: 1,
    transition: {
      staggerChildren: 0.3,
    },
  },
};

const Home = () => {
  return (
    <Box sx={{ backgroundColor: '#000000' }}>
      {/* Hero Section (Section 1) */}
      <HeroSection
        component={motion.div}
        initial="hidden"
        animate="visible"
        variants={staggerContainer}
      >
        <HeroTitle
          variant="h1"
          component={motion.div}
          variants={fadeInUp}
        >
          Premium Oversized Tees
        </HeroTitle>
        <HeroSubtitle
          variant="h5"
          component={motion.div}
          variants={fadeInUp}
        >
          Discover the ultimate blend of comfort and style with Baa M Boo’s exclusive collection of oversized tees for men and women. Crafted with premium materials for a perfect fit that lasts. Elevate your wardrobe with our curated designs, made to stand out and feel exceptional.
        </HeroSubtitle>
        <Box component={motion.div} variants={fadeInUp}>
          <HeroButton href="#shop">Shop Now</HeroButton>
        </Box>
      </HeroSection>

      {/* Business Introduction Section (Section 2) */}
      <BusinessIntroSection
        component={motion.div}
        initial="hidden"
        whileInView="visible"
        viewport={{ once: true }}
        variants={staggerContainer}
      >
        <Subtitle
          component={motion.div}
          variants={fadeInUp}
        >
          Baa M Boo Since 2023
        </Subtitle>
        <MainTitle
          component={motion.div}
          variants={fadeInUp}
        >
          Baa M Boo
        </MainTitle>
        <Box
          component={motion.div}
          variants={fadeInUp}
          sx={{ display: 'flex', gap: '20px' }}
        >
          <IntroButton href="#shop">Shop Now</IntroButton>
          <IntroButton href="#explore"> Explore </IntroButton>
        </Box>
      </BusinessIntroSection>
    </Box>
  );
};

export default Home;
